import React, { Component } from 'react';
import './Main.css'

class Main extends Component {
  state = {
    parallelogram: false
  }

  render() {
    return (
      <React.Fragment>
        <div id="main-container">
          <div id="parallelogram_container">
            <div id="parallelogram1"></div>
            <div id="parallelogram2"></div>
            <div id="parallelogram3"></div>
          </div>
          <div id="container">
            <div id="button-container">
              <button className="user-button" onClick={this.props.handleClickSignup}> Sign Up </button>
              <button className="user-button" onClick={this.props.handleClickLogin}> Log In </button>
            </div>
            <div id="app-logo" onClick={this.handleLogoClick}> BudgeIt </div>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default Main;
